<head>

    <style>

        body {

            color: #212B36;
            margin: 0;
        }

        .content {
            font-family: 'Roboto', sans-serif;
            width: 600px;
            margin: 0 auto;
            text-align: left;
            font-size: 16px;
        }

        a {
            color: #00aaf7;
            text-decoration: underline;
        }

        img {
            width: 600px;
            display: block;
            margin: 50px auto 50px;
        }

        h1 {

            font-weight: 700;
            font-size: 80px;
            line-height: 100px;
            color: #454F5B;
        }

            font-weight: 700;
            font-size: 36px;
            color: color: #212B36;
        }

        h3, h4 {
            font-family: 'Roboto Condensed', sans-serif;
            font-weight: 700;
            font-style: italic;
            font-size: 24px;
            line-height: 30px;
            color: #212B36;
            text-transform: uppercase;
        }

        p {
            font-size: 16px;
            line-height: 28px;
        }

        @media only screen and (max-width: 1440px) {
            h1 {
                font-size: 64px;
                line-height: 80px;
            }

            h2 {
                font-size: 29px;
            }

            h3 {
                font-size: 19px;
                line-height: 24px;
            }

            img,
            .content {
                width: 480px;
            }
        }

        @media only screen and (max-width: 768px) {
            h1 {
                font-size: 51px;
                line-height: 64px;
            }

            h2 {
                font-size: 23px;
            }

            h3 {
                font-size: 15px;
                line-height: 19px;
            }

            p {
                font-size: 13px;
                line-height: 22px;
            }

            img,
            .content {
                width: 90%;
                max-width: 480px;
            }
        }
    </style>
</head>
